class Home extends Component {
	constructor () {
	  super()
	  this.state = {
	    username: ''
	  }
	  this.handleClick = this.handleClick.bind(this)
	}

  render() {
    return (
      <div className="Home">
        Home
        <p>Welcome to your fridge (user)</p>
      </div>
    );
  }
}

export default Home;
